/**
 *
 *
 */
DOMAIN TIM {

	TEMPORAL_MODULE temporal_module = DATE [2018-01-12T00:00:00.000Z,2018-01-22T00:00:00.000Z], 1500; //@remark FPC is used by default

	DOMAIN_TIMELINE FLEXIBLE tim;

	//DATA_TYPE OBJECT aoi;
  DATA_TYPE ENUMERATION aoi = {Portugal, Germany};

	/*---------------------------------------------------------
	 *
	 * DATA TYPES
	 *
 	 *---------------------------------------------------------*/

	 // PARTITION_MAP netsat_partitions = {
		//  	OPTICAL : { ISENS.optical };
		// 	IR      : { ISENS.ir };
		// 	RADAR   : { ISENS.radar };
		// 	MSI     : { ISENS.msi };
	 // };

	/*---------------------------------------------------------
	 *
	 * COMPONENT TYPES
	 *
 	 *---------------------------------------------------------*/

		/**@brief Defines the interface provided by any Satellite that offers a sensor
		 *
		 */
	  COMP_TYPE STATE_VARIABLE ISensorType
	    VALUES
	    {
				DEFAULT Background();
	      NOT_ON_COMPLETION Image(aoi);
				Slew(aoi) [00:01:00,00:10:00];
	    }
	    TRANSITIONS
	    {
				// Background() TO {
				// 	Image(?aoi);
				// }
				Background() TO {
					Slew(?aoi);
				}

				Slew(?aoi1) TO {
					Image(?aoi2);
					?aoi1 = ?aoi2;
				}
				// Slew(?aoi1) TO {
				// 	Background();
				// }

				Image(?aoi) TO {
					Background();
				}
				Image(?aoi1) TO {
					Slew(?aoi2);
					?aoi1 != ?aoi2;
				}

			}

		COMP_TYPE STATE_VARIABLE AreaOfInterestType
				VALUES
				{
					NOT_ON_COMPLETION NOT_VISIBLE();
					NOT_ON_COMPLETION VISIBLE(aoi);
				}
				TRANSITIONS
				{
						// NOT_VISIBLE() TO
						// {
						// 	VISIBLE(?aoi);
						// }
						// VISIBLE(?aoi) TO
						// {
						// 	NOT_VISIBLE();
						// }
						// VISIBLE(?aoi1) TO
						// {
						// 	VISIBLE(?aoi2);
						// 	?aoi1 != ?aoi2;
						// }
				}

		// /**@brief Orbital events
		//  */
		// COMP_TYPE STATE_VARIABLE OrbitalEventType
		// 	VALUES
		// 	{
		// 		NOT_ON_COMPLETION NONE() [1, +INF];
    //
		// 		NOT_ON_COMPLETION ECLIPSE_ENTRY() [1, 1]; // the spacecraft entered the eclipse
		// 		NOT_ON_COMPLETION ECLIPSE_EXIT() [1, 1]; // the spacecraft exited the eclipse
		// 		NOT_ON_COMPLETION ECLIPSE() [1, +INF]; // the spacecraft is in eclipse
		// 		NOT_ON_COMPLETION SUNLIGHT() [1, +INF]; // the spacecraft is in sunlight
    //
		// 		NOT_ON_COMPLETION ANX(orbId) [1, 1];  // ANX crossing
		// 		NOT_ON_COMPLETION DNX(orbId) [1, 1]; // DNX crossing
		// 		NOT_ON_COMPLETION ORBIT(orbId) [1, +INF]; // 1 orbit period
		// 	}
		// 	TRANSITIONS
		// 	{}


	 COMP_TYPE RESERVOIR_RESOURCE OnboardStorageType;

	/*---------------------------------------------------------
	 *
	 * COMPONENT INSTANTIATION
	 *
 	 *---------------------------------------------------------*/

	 COMPONENT ISensorType ISENS { FLEXIBLE <COMPLETE> tim_a;  FLEXIBLE <COMPLETE> tim_b; FLEXIBLE <COMPLETE> tim_c; FLEXIBLE <COMPLETE> tim_d; FLEXIBLE <COMPLETE> tim_e; FLEXIBLE <COMPLETE> tim_f;}

	 // storage capacity: 16 GibiByte, [0, 16384] Mebibyte
	 COMPONENT OnboardStorageType STORAGE { FLEXIBLE tim_a(0.0,16384.0); FLEXIBLE tim_b(0.0,16384.0); FLEXIBLE tim_c(0.0,16384.0); FLEXIBLE tim_d(0.0,16384.0); FLEXIBLE tim_e(0.0,16384.0); FLEXIBLE tim_f(0.0,16384.0); }

	 COMPONENT AreaOfInterestType AOI { FIX_EST <fact> tim_a; FIX_EST <fact> tim_b; FIX_EST <fact> tim_c; FIX_EST <fact> tim_d; FIX_EST <fact> tim_e; FIX_EST <fact> tim_f; }

	 //COMPONENT ObservationType TIM { FLEXIBLE <COMPLETE> tl; }
	 //COMPONENT OrbitalEventType ECLIPSE { FIX_EST <fact> tl; }
	 //COMPONENT OrbitalEventType ORBIT { FIX_EST <fact> tl; }

 /*---------------------------------------------------------
	*
	* SYNCHRONISATIONS
	*
	*---------------------------------------------------------*/

	SYNCHRONIZE ISENS.tim_a {

		VALUE Background(){
			c1 STORAGE.tim_a.ACTIVITY(0.01); // 0.01 Mebibyte/second
			EQUALS c1;
		}

		VALUE Slew(?aoi){
			c1 STORAGE.tim_a.ACTIVITY(0.001); // 0.0 Mebibyte/second
			EQUALS c1;
		}

		VALUE Image(?aoi1){
			e0 AOI.tim_a.VISIBLE(?aoi2);
			c1 STORAGE.tim_a.ACTIVITY(1.0); // 0.1 Mebibyte/second
			CONTAINS e0;
			EQUALS c1;
			//?aoi1 = ?aoi2;
		}
	}

	SYNCHRONIZE ISENS.tim_b {

		VALUE Background(){
			c1 STORAGE.tim_b.ACTIVITY(0.01); // 0.01 Mebibyte/second
			EQUALS c1;
		}

		VALUE Slew(?aoi){
			c1 STORAGE.tim_b.ACTIVITY(0.001); // 0.0 Mebibyte/second
			EQUALS c1;
		}

		VALUE Image(?aoi1){
			e0 AOI.tim_b.VISIBLE(?aoi2);
			c1 STORAGE.tim_b.ACTIVITY(1.0); // 0.1 Mebibyte/second
			CONTAINS e0;
			EQUALS c1;
			//?aoi1 = ?aoi2;
		}
	}

	SYNCHRONIZE ISENS.tim_c {

	VALUE Background(){
		c1 STORAGE.tim_c.ACTIVITY(0.01); // 0.01 Mebibyte/second
		EQUALS c1;
	}

	VALUE Slew(?aoi){
		c1 STORAGE.tim_c.ACTIVITY(0.001); // 0.0 Mebibyte/second
		EQUALS c1;
	}

	VALUE Image(?aoi1){
		e0 AOI.tim_c.VISIBLE(?aoi2);
		c1 STORAGE.tim_c.ACTIVITY(1.0); // 0.1 Mebibyte/second
		CONTAINS e0;
		EQUALS c1;
		//?aoi1 = ?aoi2;
	}
	}

	SYNCHRONIZE ISENS.tim_d {

	VALUE Background(){
		c1 STORAGE.tim_d.ACTIVITY(0.01); // 0.01 Mebibyte/second
		EQUALS c1;
	}

	VALUE Slew(?aoi){
		c1 STORAGE.tim_d.ACTIVITY(0.001); // 0.0 Mebibyte/second
		EQUALS c1;
	}

	VALUE Image(?aoi1){
		e0 AOI.tim_d.VISIBLE(?aoi2);
		c1 STORAGE.tim_d.ACTIVITY(1.0); // 0.1 Mebibyte/second
		CONTAINS e0;
		EQUALS c1;
		//?aoi1 = ?aoi2;
	}
	}

	SYNCHRONIZE ISENS.tim_e {

	VALUE Background(){
		c1 STORAGE.tim_e.ACTIVITY(0.01); // 0.01 Mebibyte/second
		EQUALS c1;
	}

	VALUE Slew(?aoi){
		c1 STORAGE.tim_e.ACTIVITY(0.001); // 0.0 Mebibyte/second
		EQUALS c1;
	}

	VALUE Image(?aoi1){
		e0 AOI.tim_e.VISIBLE(?aoi2);
		c1 STORAGE.tim_e.ACTIVITY(1.0); // 0.1 Mebibyte/second
		CONTAINS e0;
		EQUALS c1;
		//?aoi1 = ?aoi2;
	}
	}

	SYNCHRONIZE ISENS.tim_f {

	VALUE Background(){
		c1 STORAGE.tim_f.ACTIVITY(0.01); // 0.01 Mebibyte/second
		EQUALS c1;
	}

	VALUE Slew(?aoi){
		c1 STORAGE.tim_f.ACTIVITY(0.001); // 0.0 Mebibyte/second
		EQUALS c1;
	}

	VALUE Image(?aoi1){
		e0 AOI.tim_f.VISIBLE(?aoi2);
		c1 STORAGE.tim_f.ACTIVITY(1.0); // 0.1 Mebibyte/second
		CONTAINS e0;
		EQUALS c1;
		//?aoi1 = ?aoi2;
	}
}



}

